import './_product.scss';
import PropTypes from 'prop-types'


export default function Product(props) {
    return (

        /* Generate a flexbox (for direction) named 'product'
       First inner div (productImage) is the product image
       Second inner div (productInfo) is the product information  */

        <div className='product'>
            <div className='productImage' style={{ height: props.height + 'px', width: props.width + 'px' }}></div>
            <div className='productInfo'>
                <p className='productName'>Product</p>
                <p className='productDesc'>Description of first product</p>
                <p className='productPrice'>$10.99</p>
                {/* <button className="quantityBtn">Quantity</button> */}
                <button className="checkoutBtn">Button</button>

            </div>
        </div>
    )
}

Product.defaultProps = {
    height: 258,
    width: 430
}

Product.propTypes = {
    height: PropTypes.number,
    width: PropTypes.number
}
